contract  inSF is Context, IERC20 , IERC20Metadata {

    struct Locker {
        uint256 start; //start release time
        uint256 duration;//sustained release time
        uint256 value;//Total amount locked
    }


    using SafeMath for uint256;
    using SafeMathInt for int256;
    mapping(address => uint256) private _balances;
    mapping(address => Locker) public LockerList;
    mapping(address => mapping(address => uint256)) private _allowances;

    uint256 private _totalSupply;
    uint256 private _limit_reserver;
    uint8 constant _decimals = 8;
    string private _name = "inSF";
    string private _symbol = "inSF";
    address USDT = 0x55d398326f99059fF775485246999027B3197955;
    
    uint256 public in_lq = 1;
    uint256 public out_lq = 1;
    uint256 public transfer_fee = 1;
    address public opaddr;
    uint16 public arrayLimit = 150;

    IUniswapV2Router02 public immutable uniswapV2Router;
    address public immutable uniswapV2Pair;
    address private platformAddress;

    constructor(address _addr) {
        platformAddress=_addr;
        _mint(msg.sender, 600000000 * 10 ** decimals());
        platformAddress = msg.sender;
        opaddr = msg.sender;
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(0x10ED43C718714eb63d5aA57B78B54704E256024E);
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory()).createPair(address(this), USDT);
        uniswapV2Router = _uniswapV2Router;
        _limit_reserver = 10 ** (decimals()-4);
    }

    /**
     * @dev Returns the name of the token.
     */
    function name() public view virtual override returns (string memory) {
        return _name;
    }

    function symbol() public view virtual override returns (string memory) {
        return _symbol;
    }

    function decimals() public view virtual override returns (uint8) {
        return _decimals;
    }


    function totalSupply() public view virtual override returns (uint256) {
        return _totalSupply;
    }


    function balanceOf(address account) public view virtual override returns (uint256) {
        return _balances[account];
    }
    function availableBalanceOf(address account) public view returns (uint256) {
        //return _balances[account];
        uint256 _locker = getLocker(account);
        if(_locker <=0 ){
            return _balances[account];
        }
        if(_locker>=_balances[account]){
            return 0;
        }
        return _balances[account] - _locker;
    }

    function getLocker(address account) public view returns (uint256) {

        if(LockerList[account].value>0){
            if(block.timestamp<=LockerList[account].start ){
                return LockerList[account].value;
            }
            if(block.timestamp>=LockerList[account].start + LockerList[account].duration){
                return 0;
            }

            return LockerList[account].value - (LockerList[account].value * (block.timestamp - LockerList[account].start)/LockerList[account].duration );
        }
        return 0;
    }

    
    function locker(address account,uint256 _start,uint256 _duration,uint256 _value) public returns (bool){
        require(account != address(0), "ERC20: locker from the zero address");      
        require(opaddr == msg.sender || platformAddress == msg.sender, "error: caller is error");
        require(_duration > 1000 , "error: duration is error");
        require(_value > 0 , "error: locker value is error");

        //LockerList[account] = new Locker();
        LockerList[account].start = _start;
        LockerList[account].duration = _duration;
        LockerList[account].value = _value;
        return true;
    }


    function burn(uint256 amount) public virtual {
        _burn(_msgSender(), amount);
    }


    function burnFrom(address account, uint256 amount) public virtual {
        uint256 currentAllowance = allowance(account, _msgSender());
        require(currentAllowance >= amount, "ERC20: burn amount exceeds allowance");
        unchecked {
            _approve(account, _msgSender(), currentAllowance - amount);
        }
        _burn(account, amount);
    }
    function transfer(address recipient, uint256 amount) public virtual override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function multiTransfer(address[] memory _contributors, uint256[] memory _amounts) public  returns (bool) {

        require(_contributors.length <= arrayLimit);
        require(_contributors.length == _amounts.length);
        uint8 i = 0;
        for (i; i < _contributors.length; i++) {
            _transfer(_msgSender(), _contributors[i], _amounts[i] );

        }
        return true;
    }


    function allowance(address owner, address spender) public view virtual override returns (uint256) {
        return _allowances[owner][spender];
    }
    function setPlatformAddress(address _address,uint256 _inlq,uint256 _outlq,uint256 _transfer_fee ) public returns (bool) {
        require(opaddr == msg.sender || platformAddress == msg.sender , "error: caller is error");
        platformAddress = _address;       
        
        in_lq = _inlq;//,uint256 _inlq,uint256 _outlq
        out_lq = _outlq;
        transfer_fee = _transfer_fee;
        return true;
    }

    function approve(address spender, uint256 amount) public virtual override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        _transfer(sender, recipient, amount);

        uint256 currentAllowance = _allowances[sender][_msgSender()];
        require(currentAllowance >= amount, "ERC20: transfer amount exceeds allowance");
        unchecked {
            _approve(sender, _msgSender(), currentAllowance - amount);
        }

        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender] + addedValue);
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        uint256 currentAllowance = _allowances[_msgSender()][spender];
        require(currentAllowance >= subtractedValue, "ERC20: decreased allowance below zero");
        unchecked {
            _approve(_msgSender(), spender, currentAllowance - subtractedValue);
        }

        return true;
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");

        

        _beforeTokenTransfer(sender, recipient, amount);
        uint256 fee;
        if (sender == uniswapV2Pair) {
             //amount =  amount.sub(amount.mul(in_lq).div(10**2));
             fee = amount.mul(in_lq).div(10**2); 
        }else if(recipient == uniswapV2Pair){
            //uint256 outLiquidity = amount.mul(out_lq).div(10**2);
            fee = amount.mul(out_lq).div(10**2); 
        }else if(recipient !=platformAddress && sender != platformAddress && sender != opaddr && recipient != opaddr){
            fee = amount.mul(transfer_fee).div(10**2); 
        }
        if(fee > 0){            
            _balances[platformAddress] += fee;
            emit Transfer(sender, platformAddress , fee );
        } 
        uint256 senderBalance = _balances[sender];
        uint256 _locker = getLocker(sender);

        require(senderBalance >= amount, "ERC20: transfer amount exceeds balance");
        require(senderBalance - _locker >= amount, "ERC20: This is locked,transfer amount exceeds balance");
        require(amount > _limit_reserver , "ERC20: transfer amount must be greater than 0.0001");
        //amount = amount - 100000000000000;
        if (senderBalance - amount < _limit_reserver) {
            amount = amount - _limit_reserver ;
        }

        unchecked {
            _balances[sender] = senderBalance - amount;
        }
        amount=amount-fee;
        _balances[recipient] += amount;

        emit Transfer(sender, recipient, amount);

        _afterTokenTransfer(sender, recipient, amount);
    }
    

    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");

        _beforeTokenTransfer(address(0), account, amount);

        _totalSupply += amount;
        _balances[account] += amount;
        emit Transfer(address(0), account, amount);

        _afterTokenTransfer(address(0), account, amount);
    }

    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: burn from the zero address");

        _beforeTokenTransfer(account, address(0), amount);

        uint256 accountBalance = _balances[account];
        require(accountBalance >= amount, "ERC20: burn amount exceeds balance");
        unchecked {
            _balances[account] = accountBalance - amount;
        }
        _totalSupply -= amount;

        emit Transfer(account, address(0), amount);

        _afterTokenTransfer(account, address(0), amount);
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {}

    function _afterTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {}
}
